                soulC _sOut( tinP , *tinP.pEtScratch , TAG( TAGiDnULL ) , flSOUL_null , ifcIDcMDsESSION_NEWsOCKETrEPLY ) ;  \
                socketC sol2( tinP , *tinP.pEtScratch , TAG( TAGiDnULL ) ) ;                                                \
